          <img className="circle responsive-img"  src={props.beer.image_url} alt=""/>
        </div>
        <div className="col m6 l6">
          <h1 className="headerProf"> {props.beer.name}</h1>
        </div>
      </div>
    </div>
  )
}

export default AllBeers;
